pragma solidity 0.5.10;


import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./DSMath.sol";

contract Auction is Ownable, DSMath {

    IERC20 public token;

    uint256 public openTime;
    uint256 public createFirstDay;

    uint256 public startTime;
    uint256 public numberOfDays;
    uint256 public createPerDay;

    mapping (uint256 => uint256) public dailyTotals;
    mapping (uint256 => mapping (address => uint256)) public userBuys;
    mapping (uint256 => mapping (address => bool)) public claimed;
    mapping (address => string) public keys;

    modifier initialized {
        require(createFirstDay > 0);
        _;
    }

    event LogBuy (uint256 window, address user, uint256 amount);
    event LogClaim (uint256 window, address user, uint256 amount);
    event LogCollect (uint256 amount);
    event LogFreeze ();
    event LogPrice (uint256 amount);

    constructor(
        uint256 _numberOfDays,
        uint256 _openTime,
        uint256 _startTime,
        IERC20  _token
    ) public {
        numberOfDays = _numberOfDays;
        openTime = _openTime;
        startTime = _startTime;
        token = _token;

        assert(numberOfDays > 0);
        assert(openTime < startTime);
    }

    function initialize() public onlyOwner {
        require(token.balanceOf(address(this)) > 0);
        createFirstDay = wmul(token.balanceOf(address(this)), 0.2 ether);
        createPerDay = sub(token.balanceOf(address(this)), createFirstDay) / numberOfDays;
    }

    function time() public view returns (uint256) {
        return block.timestamp;
    }

    function today() public view returns (uint256) {
        return dayFor(time());
    }

    function dayFor(uint256 timestamp) public view returns (uint256) {
        return timestamp < startTime
            ? 0
            : sub(timestamp, startTime) / 23 hours + 1;
    }

    function createOnDay(uint256 day) public view returns (uint256) {
        return day == 0 ? createFirstDay : createPerDay;
    }

    function buyWithLimit(uint256 day, uint256 limit) public payable initialized {
        assert(time() >= openTime && today() <= numberOfDays);
        assert(msg.value >= 0.01 ether);

        assert(day >= today());
        assert(day <= numberOfDays);

        userBuys[day][msg.sender] += msg.value;
        dailyTotals[day] += msg.value;

        if (limit != 0) {
            assert(dailyTotals[day] <= limit);
        }

        emit LogBuy(day, msg.sender, msg.value);
    }

    function buy() public payable initialized {
       buyWithLimit(today(), 0);
    }

    function () external payable initialized {
       buy();
    }

    function claim(uint256 day) public initialized {
        assert(today() > day);

        if (claimed[day][msg.sender] || dailyTotals[day] == 0) {
            return;
        }

        uint256 price = wdiv(createOnDay(day), dailyTotals[day]);
        uint256 reward = wmul(price, userBuys[day][msg.sender]);

        claimed[day][msg.sender] = true;
        token.transfer(msg.sender, reward);

        emit LogPrice(price);
        emit LogClaim(day, msg.sender, reward);
    }

    function claimAll() public initialized {
        for (uint256 i = 0; i < today(); i++) {
            claim(i);
        }
    }

    function collect() public onlyOwner initialized {
        assert(today() > 0);
        address(this).transfer(address(this).balance);

        emit LogCollect(address(this).balance);
    }

    function freeze() public initialized {
        assert(today() > numberOfDays + 1);
        emit LogFreeze();
    }
}
